import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import React from "react";

function Paginado (props){
return [
    <Container className='bg-light p-2' id="paginado_container">
    <Button disabled={props.anterior_state} id='anterior_tabla' variant={'outline-primary margin_left_085rem ' } onClick={props.goOnPrevPage}>Anterior</Button>
    <Button id='siguiente_tabla' variant={'outline-primary margin_left_085rem ' + (props.siguiente_state ? '' : 'disabled')} onClick={props.goOnNextPage}>Siguiente</Button>
</Container>
]
}
export default Paginado;
